import React from "react";
import { Button } from "@material-ui/core";

import "./index.scss";
export const PrimaryButton = ({ children, backgroundColor = "", ...rest }) => (
  <Button
    className="primary-button"
    style={{ backgroundColor: "#7ed9d9" }}
    {...rest}
  >
    {children}
  </Button>
);
